function Form() {
    return (
        <div className="form">
            <form >
                <h1>Form</h1>
                <label >Country                </label>

                <input type="text" placeholder="Enter your Country name" />
                <input type="text" placeholder="Enter you State name" />
                <input type="text" placeholder="Enter you District name" />
                <input type="text" placeholder="Enter you Village name" />
            </form>
        </div>
    )
}
export default Form;
